import React from "react";
import { Link } from "react-router-dom";
import BannerImage from "../assets/ItDish.jpg";
import "../styles/Home.css";

function Home() {
  return (
    <div
      className="home"
      style={{ backgroundImage: `url(${BannerImage})`, opacity: "70%" }}
    >
      <div className="headerContainer">
        <h1> Mama Mia Italian'o </h1>
        <p>Food of your choice</p>
        <Link to="/menu">
          <button> ORDER NOW </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
